import React from "react"; 

//Style Of Component
import './listGenerator.scss';

const ListGenerator = () => {

    return(
        <div className="todolist-listgenerator">
            <div className="listgenerator-table-container"> 
                <div className="name-container"> 
                    <div className="name-title"> 
                        <label className="name-text"> "persona assegnata" </label>
                    </div>  
                    <div className="name-text"> 
                    </div> 
                </div> 

                <div className="description-container"> 
                    <div className="description-title"> 
                        <label className="text-description"> "descrizione" </label>
                    </div>  
                    <div className="description-text"> 
                    </div> 
                </div> 

                <div className="progres-container"> 
                    <div className="progres-title"> 
                        <label className="text-description"> "stato lavoro" </label>
                    </div>  
                    <div className="progres-text"> 
                    </div> 
                </div> 

                <div className="completed-container"> 
                    <div className="completed-title"> 
                        <label className="text-description"> "completato" </label>
                    </div>  
                    <div className="completed-text"> 
                    </div> 
                </div> 

            </div> 
        </div>
    )
}

ListGenerator.propTypes = { 
}; 

ListGenerator.defaultProps = { 
};




export default React.memo(ListGenerator);
